import React from "react";
import "./App.css";
import Navbar from "./components/navbar";
import Main from "./components/image-area";
import Image from "./images/main-image-2.jpg";
import Widget from "./components/widget";
import Client from "./components/client";
import Card from "./components/card";

function App() {
  return (
    <div className="App">
      <div
        className="image-area"
        style={{ color: "white", backgroundImage: `url( ${Image} )` }}
      >
        <Navbar></Navbar>
        <Main></Main>
      </div>
      <Widget></Widget>
      <div style={{ textAlign: "center" }}>
        <h1>We've Unlocked The Market</h1>
        <p style={{ width: "60%", margin: "auto" }}>
          After 7 years researching kids’ speech patterns and behaviors, we’ve
          developed voice technology for kids that is accurate, private, and
          scalable enough to become the gold standard across education and
          entertainment for kids markets globally.
        </p>
      </div>
      <Client></Client>
      <Card></Card>
    </div>
  );
}

export default App;
